INSERT INTO `games` (`id`, `game_name`, `description`, `image`, `pc_only`, `created_at`, `updated_at`, `image_banner`, `game_link`) VALUES
(8, 'OVER WATCH', '{\"en\":\"<p><span style=\\\"color: rgb(77, 81, 86); font-family: arial, sans-serif;\\\">Overwatch is a 2016 team-based multiplayer first-person shooter developed and published by Blizzard Entertainment. Described as a \\\"hero shooter\\\", Overwatch assigns players into two teams of six, with each player selecting from a large roster of characters, known as \\\"heroes\\\", with unique abilities<\\/span><br><\\/p>\\n\",\"ar\":\"<p><span style=\\\"color: rgb(77, 81, 86); font-family: arial, sans-serif;\\\">Overwatch is a 2016 team-based multiplayer first-person shooter developed and published by Blizzard Entertainment. Described as a \\\"hero shooter\\\", Overwatch assigns players into two teams of six, with each player selecting from a large roster of characters, known as \\\"heroes\\\", with unique abilities<\\/span><br><\\/p>\"}', '1621846491.png', 1, '2021-05-22 08:20:43', '2021-05-27 20:54:15', '1622123655.jpg', 'overwatch'),
(9, 'APEX  LEGENDS', '{\"en\":\"<p><span style=\\\"color: rgb(77, 81, 86); font-family: arial, sans-serif;\\\">Apex Legends is a free-to-play hero battle royale game developed by Respawn Entertainment and published by Electronic Arts. It was released for Microsoft Windows, PlayStation 4, and Xbox One in February 2019, and for Nintendo Switch in March 2021. The game supports cross-platform play.<\\/span><br><\\/p>\\n\",\"ar\":\"<p><span style=\\\"color: rgb(77, 81, 86); font-family: arial, sans-serif;\\\">Apex Legends is a free-to-play hero battle royale game developed by Respawn Entertainment and published by Electronic Arts. It was released for Microsoft Windows, PlayStation 4, and Xbox One in February 2019, and for Nintendo Switch in March 2021. The game supports cross-platform play.<\\/span><br><\\/p>\"}', '1621846501.png', 1, '2021-05-22 08:57:41', '2021-05-25 14:54:07', '1621648661.jpg', 'Apex Legends'),
(10, 'LEAGUE OF LEGENDS', '{\"en\":\"<p><span style=\\\"color: rgb(77, 81, 86); font-family: arial, sans-serif;\\\">League of Legends, commonly referred to as League, is a 2009 multiplayer online battle arena video game developed and published by Riot Games. Inspired by Defense of the Ancients, a custom map for Warcraft III, Riot\'s founders sought to develop a stand-alone game in the same genre<\\/span><br><\\/p>\\n\",\"ar\":\"<p><span style=\\\"color: rgb(77, 81, 86); font-family: arial, sans-serif;\\\">League of Legends, commonly referred to as League, is a 2009 multiplayer online battle arena video game developed and published by Riot Games. Inspired by Defense of the Ancients, a custom map for Warcraft III, Riot\'s founders sought to develop a stand-alone game in the same genre<\\/span><br><\\/p>\"}', '1621846524.png', 1, '2021-05-22 10:31:40', '2021-05-25 06:55:50', '1621654300.jpg', 'League of legends'),
(11, 'CALL OF DUTY  CW', '{\"en\":\"<p><span style=\\\"color: rgb(77, 81, 86); font-family: arial, sans-serif;\\\">Call of Duty: Black Ops Cold War is a 2020 first-person shooter video game developed by Treyarch and Raven Software and published by Activision.<\\/span><br><\\/p>\\n\",\"ar\":\"<p><span style=\\\"color: rgb(77, 81, 86); font-family: arial, sans-serif;\\\">Call of Duty: Black Ops Cold War is a 2020 first-person shooter video game developed by Treyarch and Raven Software and published by Activision.<\\/span><br><\\/p>\"}', '1621846535.png', 1, '2021-05-22 22:02:12', '2021-05-25 06:59:16', '1621695731.png', 'Call of duty CW'),
(12, 'CALL OF DUTY MW', '{\"en\":\"<p><span style=\\\"color: rgb(77, 81, 86); font-family: arial, sans-serif;\\\">Call of Duty: Modern Warfare is a 2019 first-person shooter video game developed by Infinity Ward and published by Activision<\\/span><br><\\/p>\\n\",\"ar\":\"<p><span style=\\\"color: rgb(77, 81, 86); font-family: arial, sans-serif;\\\">Call of Duty: Modern Warfare is a 2019 first-person shooter video game developed by Infinity Ward and published by Activision<\\/span><br><\\/p>\"}', '1621846545.png', 1, '2021-05-22 22:04:16', '2021-05-24 15:55:45', '1621695856.png', 'Call of duty MW'),
(14, 'VALO RANT', '{\"en\":\"<p>asdfasdfsdfsadfasdfasdfdddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddd<\\/p>\\n\",\"ar\":\"<p>dddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddd<\\/p>\"}', '1622123299.png', 1, '2021-05-27 20:48:20', '2021-05-29 20:35:12', '', 'Valorant');
